import React from 'react';
import Table from 'react-bootstrap/Table';

export default function Tenantdata() {
  return (
<Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Username</th>
        </tr>
      </thead>
      </Table>
  )
}
